class Threess_Widget2 extends \Elementor\Widget_Base {

	public function get_script_depends() {
		return [ 'three-export-script'];
	}

	public function get_style_depends() {
		return [ 'three-export-style'];
	}

	public function get_name() {
		return 'threess2';
	}

	public function get_title() {
		return esc_html__( 'Three S S 22', 'elementor-addon' );
	}

	public function get_icon() {
		return 'eicon-code';
	}

	public function get_categories() {
		return [ 'aka-codes' ];
	}

	public function get_keywords() {
		return [ 'hello', 'world' ];
	}

	protected function register_controls() {

		// Content Tab Start

		$this->start_controls_section(
			'section_title',
			[
				'label' => esc_html__( 'BG Text', 'elementor-addon' ),
				'tab' => \Elementor\Controls_Manager::TAB_CONTENT,
			]
		);

		$this->add_control(
			'title',
			[
				'label' => esc_html__( 'Enter Text', 'elementor-addon' ),
				'type' => \Elementor\Controls_Manager::TEXTAREA,
				'default' => esc_html__( '@akacodes', 'elementor-addon' ),
			]
		);

		$this->add_control(
            'section_height',
            [
                'label' => __( 'Section Height', 'text-domain' ),
                'type' => \Elementor\Controls_Manager::NUMBER,
                'default' => 300,
                'min' => 100,
                'max' => 1000,
                'step' => 1,
                'description' => __( 'Set the height for sections.', 'text-domain' ),
            ]
        );



		$this->end_controls_section();

		// Content Tab End


		// Style Tab Start

		$this->start_controls_section(
			'section_title_style',
			[
				'label' => esc_html__( 'Title', 'elementor-addon' ),
				'tab' => \Elementor\Controls_Manager::TAB_STYLE,
			]
		);

		$this->add_control(
			'title_color',
			[
				'label' => esc_html__( 'Text Color', 'elementor-addon' ),
				'type' => \Elementor\Controls_Manager::COLOR,
				'selectors' => [
					'{{WRAPPER}} .hello-world' => 'color: {{VALUE}};',
				],
			]
		);

		// Add Typography control
		$this->add_group_control(
						\Elementor\Group_Control_Typography::get_type(),
				[
						'name' => 'title_typography', // Unique name for the typography control
						'label' => __( 'Typography', 'text-domain' ),
						'selector' => '{{WRAPPER}} .integral', // The CSS selector of the text element to apply typography
						'default' => [
                    'font_size' => '76.6px', // Set the default font size here
                ],
				]
		);

		$this->end_controls_section();

		// Style Tab End

	}

